import React, {useState} from "react";

const Counter = () => {
    const [textValue, setNumber] = useState("");

    const onChange = (e) => {
        setTextValue(e.target.value)
    };

    return (
        <div>
            <input type="text" value="" onChange={onChange} />
            <br />
            <p>{textValue}</p>
        </div>
    )
}

export default Counter;
